import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import FilteredList from './FilteredList'

import { AwesomeButton } from "react-awesome-button";
import { Dropdown } from 'react-bootstrap';
import "react-awesome-button/dist/styles.css";
import 'bootstrap/dist/css/bootstrap.min.css';

class App extends React.Component {

  constructor(props) {
    super(props);
  }


  render() {

    const stocks = [
      {name: "Apple", stockPrice: 100, sector: "technology"},
      {name: "Microsoft", stockPrice: 80, sector: "technology"},
      {name: "Samsung", stockPrice: 55, sector: "technology"},
      {name: "Samsung", stockPrice: 55, sector: "technology"},
      {name: "Delta", stockPrice: 35, sector: "airline"},
      {name: "JetBlue", stockPrice: 15, sector: "airline"},
      {name: "American Airlines", stockPrice: 15, sector: "airline"},
      {name: "United", stockPrice: 15, sector: "airline"},
      {name: "Starbucks", stockPrice: 15, sector: "food"},
      {name: "McDonalds", stockPrice: 15, sector: "food"},
      {name: "Domino’s Pizza Inc", stockPrice: 15, sector: "food"},
      {name: "Chipotle Mexican Grill Inc", stockPrice: 15, sector: "food"},
    ];


    return (
      <div>
        <FilteredList list={stocks} />
      </div>
    )
  }
}

export default App;
